  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs Migratory
  Waterfowl Refuge outlines Refuge accomplishments from Febuary through April of 1939.
  The report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds and upland game birds- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and plantings. A progress report on field investigations and applied research is
  also provided. Photographs are attached.\",\n\t\"license_title\": \"License Not
